import React, { Component } from 'react';
import VideoDetails from '../assets/Data/video-details.json';


class VideoDescrib extends Component {
    render() {

        return (
            <div className='video__section' >
            {VideoDetails.map((details, i) => {
                return (
                <>
                <div className='video__section--title'>{details.title}</div>
                <div className='video__section--user__name'>{}</div>
                <div className='video__section--date'></div>
                <div className='video__section--views'></div>
                <div className='video__section--likes'></div>
                <div className='video__section--description'></div>
                <div className='video__section--comment__count'></div>
                </>
                )
            })}
            </div>
        )
    }
}

export default VideoDescrib
